    } from 'react-router-dom'




const SignUpFlow = ({props}) => {
    const [role, setRole] = useState('Diif');
    return (
        <>
        <UserRole.Provider value={{role, setRole}}>
        <h1> { role } </h1>
        <button onClick={() => setRole(200)}> setRole </button>
        <Routes>
            <Route path= '/'
                action={({ props }) => {}}
                element = {
                    <ChooseRolePage />
                }

                />;
            <Route path={'../' + Constantans.REG_FORM}
                action={({ props }) => {}}
                element = {<QuestionnairePage />}
                />;
        </Routes>
        </ UserRole.Provider>
        </>
  );
                    };
export default SignUpFlow;
